import React from "react";
import Students from "./components/Students";
const data = [
    { name: "Sanaya", class: "2nd", subject: "Maths", school: "Oxford school" },
    { name: "Anaya", class: "3rd", subject: "Hindi", school: "Blue Hills school" },
    { name: 'junaid', class: "12th", subject: "English", school: "Monum school" }
]

function SamrinApp() {
    return (
        <div>
            <Students data={data} />

        </div>
        
    );
}
export default SamrinApp;
